{
  "lerna": "3.20.2",
  "packages": [
    "packages/razzle",
    "packages/razzle-start-server-webpack-plugin",
    "packages/babel-preset-razzle",
    "packages/create-razzle-app",
    "packages/razzle-dev-utils",
    "packages/razzle-plugin-*"
  ],
  "useWorkspaces": true,
  "npmClient": "yarn",
  "command": {
    "bootstrap": {
      "nohoist": "express"
    },
    "publish": {
      "npmClient": "npm",
      "allowBranch": [
        "master",
        "canary",
        "finch"
      ],
      "registry": "https://registry.npmjs.org/"
    }
  },
  "changelog": {
    "repo": "jaredpalmer/razzle",
    "labels": {
      "tag: new feature": ":rocket: New Feature",
      "tag: breaking change": ":boom: Breaking Change",
      "tag: bug fix": ":bug: Bug Fix",
      "tag: enhancement": ":nail_care: Enhancement",
      "tag: documentation": ":memo: Documentation",
      "tag: internal": ":house: Internal"
    },
    "cacheDir": ".changelog"
  },
  "version": "4.2.15"
}
